import ExpenseItem from "./components/ExpenseItem";
import Product from "./components/Product";
function App() {
  const expenses = [
    {
      id: "1",
      title: "Car Insurnce",
      amount: 94.12,
      date: new Date(2012,2,12),
    },
    {
      id: "2",
      title: "New Tv",
      amount: 98.08,
      date: new Date(),
    },
    {
      id: "3",
      title: "New Bike",
      amount: 9888.08,
      date: new Date(),
    },
  ];

  const items = [
    {
      name: "Purple Sneakers",
      price: "$24",
      type: "For Casual",
      img: 
    "https://ng.jumia.is/unsafe/fit-in/300x300/filters:fill(white)/product/82/6142201/1.jpg?2933" 

    },
    {
      name: "Black Sneakers",
      price: "$23",
      type: "Suit Wear",
      img: "https://ng.jumia.is/unsafe/fit-in/300x300/filters:fill(white)/product/01/241417/1.jpg?6747" 

    },
    {
      name: "Brown Sneakers",
      price: "$25",
      type: "Rear Wear",
      img: "https://ng.jumia.is/unsafe/fit-in/300x300/filters:fill(white)/product/06/4410121/1.jpg?4437" 

    },
  ];
  return (
    <div>
      <h1>PRODUCTS</h1>
      <div className="App">
        <Product
          type={items[0].type}
          name={items[0].name}
          price={items[0].price}
          img={items[0].img}
        />
        <Product
         type={items[1].type}
          name={items[1].name}
          price={items[1].price}
          img={items[1].img}
        />
        <Product
         type={items[2].type}
          name={items[2].name}
          price={items[2].price}
          img={items[2].img}
        />
      </div>

      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[1].title}
        amount={expenses[1].amount}
        date={expenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[2].title}
        amount={expenses[2].amount}
        date={expenses[2].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
